class Solution212 {
    List<String> reslut = new ArrayList<>();
    boolean success = false;
    char[][] target;
    public List<String> findWords(char[][] board, String[] words) {
        target = board;
        Arrays.sort(words);
        for (int i = 0; i < words.length; i++) {
            String str = words[i];
            if(i>=1) {
                if(str.equals(words[i-1])) continue;
            }
            for (int j = 0; j < board.length; j++) {
                for (int k = 0; k < board[0].length; k++) {
                    int col = board[0].length;
                    boolean[][] flag = new boolean[board.length][col];
                    if(str.charAt(0)==board[j][k]) {
                        flag[j][k] = true;
                        resolve(new Node(j,k),0,str,flag);
                    }
                    if(success) break;
                }
                if(success) break;
            }
            success = false;
        }
        return reslut;
    }

    private void resolve(Node node, int cur, String str,boolean[][] flag) {
        if(cur==str.length()-1) {
            reslut.add(str);
            success = true;
        } else {
            List<Node> nodes = validNodes(node,flag,cur+1,str);
            for (int i = 0; i < nodes.size(); i++) {
                Node n = nodes.get(i);
                flag[n.getRow()][n.getCol()] = true;
                resolve(n,cur+1,str,flag);
                if(success) return;
                flag[n.getRow()][n.getCol()] = false;
            }
        }
    }

    private List<Node> validNodes(Node node,boolean[][] flag,int cur,String str) {
        List<Node> temp = new ArrayList<>();
        int row = node.getRow();
        int col = node.getCol();

        int rowL = row -1;
        if(rowL>=0&&!flag[rowL][col]&&str.charAt(cur)==target[rowL][col]) {
            temp.add(new Node(rowL,col));
        }

        int rowR = row +1;
        if(rowR<target.length&&!flag[rowR][col]&&str.charAt(cur)==target[rowR][col]) {
            temp.add(new Node(rowR,col));
        }

        int colU = col -1;
        if(colU>=0&&!flag[row][colU]&&str.charAt(cur)==target[row][colU]) {
            temp.add(new Node(row,colU));
        }

        int colD = col +1;
        int max = target[0].length;
        if(colD<max&&!flag[row][colD]&&str.charAt(cur)==target[row][colD]) {
            temp.add(new Node(row,colD));
        }
        return  temp;

    }

}

class Node {
    private int row;
    private int col;

    public int getRow() {
        return row;
    }

    public int getCol() {
        return col;
    }

    public Node(int row, int col) {
        this.row = row;
        this.col = col;
    }
}